import * as ACTION_TYPES from '../actions/action_types';

export const initialState = {
	is_authenticated: false,
	db_profile: null
};

export const reducer = (state = initialState, action) => {
	switch (action.type) {
		case ACTION_TYPES.ADD_USERS: {
			return [...state, action.payload];
		}
		default:
			return state;
	}
};
